  background-color: rgba(67, 76, 94, 0.8);
}
atom-text-editor .wrap-guide {
  background-color: #4C566A;
}
atom-text-editor .find-result .region.region.region,
atom-text-editor .current-result .region.region.region {
  background-color: rgba(136, 192, 208, 0.3);
  transition: border-color 400ms;
}
atom-text-editor .current-result .region.region.region {
  background-color: rgba(136, 192, 208, 0.38);
  border: 2px solid #88C0D0;
  transition-duration: 400ms;
}
atom-text-editor .find-result .region.region.region {
  border: 2px solid transparent;
}
atom-text-editor .gutter {
  font-weight: 300;
  -webkit-font-smoothing: antialiased;
  background-color: #2E3440;
  margin-right: 0;
  border-right: 0;
  padding-right: 0;
}
atom-text-editor .gutter .line-numbers {
  background: transparent !important;
}
atom-text-editor .gutter .line-number {
  background: transparent;
  color: rgba(216, 222, 233, 0.4);
  padding-right: 0;
}
